import React, { Component } from 'react';
import Layout from '../../components/Layout';

class ShowCampaign extends Component {
    render() {
        return (
        <Layout>
            <h3>Show Campaign</h3>
        </Layout>
        );
    }
}

export default ShowCampaign;
